import React from 'react'

const initialEmployee = {
    employee : [
        {id:1,name:"Dhruval soni",role:"owener",image:"",email:"dhruval@gmail.com",number:"7878787478",salary:100000,time:"5:30"},
        {id:1,name:"Jaymin patel",role:"CEO",image:"./photo/ceo.jpg",email:"jaymin@gmail.com",number:"6587585965",salary:70000,time:"8:30"},
        {id:1,name:"Lehri abhishek",role:"manager",image:"./photo/",email:"abhishek@gmail.com",number:"8788852578",salary:70000,time:"9:30"}
    ]
}

const EmployeeReducer = (state=initialEmployee, action) => {
    switch(action.type){
        default: 
            return state;}
}

export default EmployeeReducer;
